package org.eclipse.vorto.plugins.generator.lambda.meta.plugins.plugins;

import org.eclipse.vorto.codegen.openapi.OpenAPIGenerator;
import org.eclipse.vorto.plugin.generator.GeneratorPluginInfo;

public class OpenAPIPluginInfo implements IPluginMeta {

  private static final String LOGO_144x144 = "";
  private static final String LOGO_32x32 = LOGO_144x144;
  
  private GeneratorPluginInfo info = null;
  
  public OpenAPIPluginInfo() {
    OpenAPIGenerator azure = new OpenAPIGenerator();
    
    info = azure.getMeta();
    info.setImage144x144(LOGO_144x144);
    info.setImage32x32(LOGO_32x32);
  }
  
  @Override
  public GeneratorPluginInfo getInfo() {
    return info;
  }
}
